  [],\n\t\"revision_timestamp\": \"2015-05-06T22:13:00.152968\",\n\t\"name\": \"second-generation-low-cost-cryocooler-electronics-lcce-2-project-7eb7f\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The LCCE-2 Program builds off the successes
  of the USAF \"Low Cost Cryocooler Electronics for Space Missions\" Program, extending
  the performance of the developed LCCE to include active vibration cancellation and
  advanced input power bus circuitry. The former is important for imaging payloads
  because the exported vibration from the cryocooler can be a major contributor to
  the overall image jitter. The latter will provide the ability to safely operate
  the cryocooler system off of virtually any spacecraft power bus from all perspectives,
  meaning that the cryocooler system will be protected from transient effects from
  a \"dirty bus,\" and the cryocooler will not impart back onto the power bus large
  amplitude current ripple that would otherwise affect the performance of other devices
  on the bus.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
